import React from 'react';
 import {format, toDate} from "date-fns";


const Created = ({date:timestamp}) =>{

    console.log(timestamp, toDate(timestamp * 1000))
    return (
        <div className="record-createdAt">
            <span>{timestamp}</span>
        </div>
    )
}


export default Created;
